import React from 'react';

const Frame130 = () => {
  return (
    <div
      className="frame-container"
      style={{
        padding: '100px 168px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
        background: 'linear-gradient(90deg, #F23D31 0%, #D23429 100%)',
        minHeight: '560px', // Ensures at least 560px, but will hug content if more
      }}
    >
      {/* Frame 130 content goes here */}
    </div>
  );
};

export default Frame130;
